import React, { useState, useEffect } from 'react'
import { GoogleMap, Marker, useJsApiLoader } from '@react-google-maps/api';
import axios from 'axios';

const containerStyle = {
  width: '800px',
  height: '550px'
};

const center = {
  lat: -3.745,
  lng: -38.523
};
const center2 = {
  lat: -23.53255315178476,
  lng: -46.647644117756045
};

function MyComponent() {
  const { isLoaded } = useJsApiLoader({
    id: 'google-map-script',
    googleMapsApiKey: "AIzaSyCfPgkys_hqQcfea7wLFl9_uZKYsGoHSek"
  })

  const [map, setMap] = React.useState(null)

  const onLoad = React.useCallback(function callback(map) {
    const bounds = new window.google.maps.LatLngBounds();
    map.fitBounds(bounds);
    setMap(map)
  }, [])

  const onUnmount = React.useCallback(function callback(map) {
    setMap(null)
  }, [])

  function listarLugares() {

    const [ListaLugares, atualizaLugares] = useState([])
    axios('https://623d99bee8fbc4f16264b76d.mockapi.io/Lugares', {
        }).then(resposta => {
            if (resposta.status === 200) {
                atualizaLugares(resposta.data)
                return ListaLugares;
            }
        })
            .catch(erro => console.log(erro));
  }

  return isLoaded ? (
    <GoogleMap
      mapContainerStyle={containerStyle}
      center={center}
      zoom={10}
      onLoad={onLoad}
      onUnmount={onUnmount}
    >
      { /* Child components, such as markers, info windows, etc. */}

      {
        listaLugares = listarLugares,
        console.log(listaLugares),
        listaLugares.forEach(element => {
          const center3 = {
            lat: element.lat,
            lng: element.lng
          };
          <Marker position={center3} />
        })
      }
    </GoogleMap>
  ) : <></>
}

export default MyComponent
